export default function Wastedisplay({ data }) {
    if (!data || data.length === 0) {
      return <p>No waste reports available</p>;
    }

    return (
      <div style={{ padding: "20px", maxWidth: "600px", margin: "auto" }}>
        <h2 style={{ fontSize: "22px", fontWeight: "bold", marginBottom: "15px" }}>Waste Reports</h2>
        {data.map((item, index) => (
          <div key={index} style={{ border: "1px solid #ccc", borderRadius: "10px", padding: "15px", marginBottom: "15px", boxShadow: "2px 2px 12px rgba(0,0,0,0.1)" }}>
            {item.image_path && <img src={`http://localhost:5000/uploads/${item.image_path}`} alt="Waste" style={{ width: "100%", borderRadius: "5px" }} />}
            <p><strong>Address:</strong> {item.address}</p>
            <p><strong>Estimated Quantity:</strong> {item.quantity} kg</p>
            {item.latitude && item.longitude && (
              <p><strong>Location:</strong> {item.latitude}, {item.longitude}</p>
            )}
          </div>
        ))}
      </div>
    );
  }
